sys_variable_value.value:
var insertRecord = new InsertRecordsIntoManyTable();
var communities = new GlideRecord('x_15401_data_gover_m2m_dsr_to_community');
communities.addQuery("data_sharing_request", current.sys_id);
communities.query();
while(communities.next()) {
	var dsa = new GlideRecord('x_15401_data_gover_data_sharing_agreement');
	dsa.initialize();
	dsa.data_sharing_request = current.sys_id;
	dsa.community = communities.community.sys_id;
	dsa.application_name = current.application_name;
	dsa.description_of_need = current.description_of_need;
	dsa.description_of_project = current.description_of_project;
	dsa.scope_of_project = current.scope_of_project;
	dsa.name = current.name + " - " + communities.community.name;
	dsa.sponsor = current.sponsor;
	dsa.requester = current.requester;
	dsa.watch_list = current.watch_list;
	dsa.development_group = current.development_group;
	dsa.application_description = current.application_description;
	dsa.insert();
	//Find API Records
	insertRecord.insertEncodedRecordsM2M('x_15401_data_gover_m2m_dsr_to_api', 'data_sharing_request=' + current.sys_id, 'x_15401_data_gover_api', 'x_15401_data_gover_m2m_dsa_to_api', 'data_sharing_agreement', 'api', dsa.sys_id, 'api');
	insertRecord.insertEncodedRecordsM2M('x_15401_data_gover_m2m_additional_df_to_dsr', 'data_field.community=' + communities.community.sys_id + '^data_sharing_request=' + current.sys_id, 'x_15401_data_gover_data_field', 'x_15401_data_gover_m2m_additional_df_to_dsa', 'data_sharing_agreement', 'data_field', dsa.sys_id, 'data_field');
	insertRecord.insertEncodedRecordsM2M('x_15401_data_gover_m2m_required_df_to_dsr', 'data_field.community=' + communities.community.sys_id + '^data_sharing_request=' + current.sys_id, 'x_15401_data_gover_data_field', 'x_15401_data_gover_m2m_required_df_to_dsa', 'data_sharing_agreement', 'data_field', dsa.sys_id, 'data_field');
	//Putting at the end of loop to fire off the DSA Workflow
	dsa.status = "Custodian";
	dsa.update();
}

